import React from 'react';
import Navbar from '../Navbar';
import Products from '../Products';
import Footer from '../Footer';

const Productsss = () => {
  return (
    <>
        <Navbar/>
        <Products/>
        <Footer/>
    </>
  )
}

export default Productsss;
